INSERT IGNORE INTO `creature_movement` VALUES ('56348','1','-2287.88','5221.7','-9.98743','45000',NULL,NULL,NULL,NULL,NULL,NULL,'0','0','0','2.89417','0','0');
INSERT IGNORE INTO `creature_movement` VALUES ('56348','2','-2287.88','5221.7','-9.98743','45000',"Come one, come all! Welcome to the Darkmoon Faire! Do you crave adventure? Do you seek exotic and mysterious treasures? Then look no further! You, my friend, have come to the right place! Dive right in and take part in all that the Faire has to offer! We'll be at this location all week, so be sure to tell your friends and loved ones!","Everyone enjoying themselves so far? That's great! Welcome to the Darkmoon Faire, the greatest show in all of Outland! Make sure that you speak with Yebb and his friends here while you're taking in Neblegear's Darkmoon Zoo Bizarre.",NULL,NULL,NULL,NULL,'0','0','0','2.89417','0','0');
INSERT IGNORE INTO `creature_movement` VALUES ('56348','3','-2271.06','5218.77','-9.98373','0',NULL,NULL,NULL,NULL,NULL,NULL,'0','0','0','2.89417','0','0');
