INSERT IGNORE INTO `creature_movement` VALUES ('56348','6','-2240.0','5194.25','-10.4829','45000',"Welcome one and all to the Darkmoon Faire, the greatest event in all the worlds! We have it all... delicious food, strong drinks, exotic artifacts, fortunes read, amazing prizes and excitement without end! Don't forget to turn in your Darkmoon Faire Prize Tickets to Gelvas Grimegate! All it takes is five or more and you're on your way to the most wondrous prizes in all of Outland. Everybody is a winner","Greetings friends, and welcome to the greatest show on Azeroth!$B$BPlease, step right up and take in all we have to offer. Ride the rides and see the sights! Amaze at the wonders that the Darkmoon Faire has uncovered in this vast and mysterious world! We have spared no expense in bringing you excitement that children of all ages will delight in!",NULL,NULL,NULL,NULL,'0','0','0','5.38389','0','0');
