update `quest_template` set `RequestItemsText` = 'Step right up, step right up! If you have tickets from the Darkmoon Faire you\'d like redeemed, then just say so! You can redeem tickets in various denominations for wondrous and fantastic prizes. Don\'t be shy, give it a try!' where `entry` in (7932, 7935, 7930, 7931, 7933, 9249, 7936, 7934, 7940, 7981);
update `quest_template` set `RequestItemsText` = 'We at the Darkmoon Faire do much walking. We walk from one faire site to another... in fact, you\'ll never see us sitting down on the job! So it is no surprise that we wear out quite a lot of boots! We need boots that are both durable and stylish, and embossed leather boots fit that bill rather well.$B$BYou! You\'re a leatherworker; make me embossed leather boots and I\'ll give you a Darkmoon Faire ticket for the work.' where `entry` = 7881;
update `quest_template` set `RequestItemsText` = 'Our Faire workers do more than sweep trash and hammer spikes! They also help guard the carnival as it travels, and to that end they are always needing good sturdy armor jerkins.$B$BIf you make some tough leather armor and bring it to me, then I\'ll make sure it gets to the right people. I\'ll also get you some Darkmoon Faire tickets as trade.' where `entry` = 7882;
update `quest_template` set `RequestItemsText` = 'Yebb Nebblegear is looking to add more talent to his show, and he\'s searching far and wide for the world\'s largest gnome. Do you know any gnomes of considerable size?$B$BWell before he finds the gnome, he wants to have its costume ready. I think a barbaric harness would be a good foundation for the costume; can you make some harnesses and bring them to me? Do that, and I\'ll have a stack of Darkmoon Faire tickets for you...' where `entry` = 7883;
update `quest_template` set `RequestItemsText` = 'Yebb is working on other attractions for his zoo, including wet, swampy abodes for a boy raised by crocolisks, and perhaps for a murloc. We will need nice, water-tight leggings so we won\'t get waterlogged during prop-ups and tear-downs. For that job, I think turtlescale leggings will do the trick.$B$B$N, can you make those leggings? If you do, then a fat stack of Darkmoon Faire tickets will be your reward...' where `entry` = 7884;
update `quest_template` set `RequestItemsText` = 'You might not realize this, but running a traveling carnival is costly! Everything wears down so fast it\'s a wonder we can turn a profit.$B$BBecause of all those hidden costs, we\'re always looking for ways to maintain our equipment as cheaply as possible. Our tents, for instance, tear regularly but I\'ve found that leather armor kits make great patches. Can you find and bring me some armor kits? That\'ll save us a bundle! Do that, and I have a fistful of Darkmoon Faire tickets for you...' where `entry` = 7885;
update `quest_template` set `RequestItemsText` = 'It takes a lot of work to be the strongest woman alive! My weight set is getting too light and if I\'m to stay fit then I\'ll need more weights!$B$BDo you think you could bring me some weight stones? If you do, then I\'ll give you a Darkmoon Faire ticket.' where `entry` = 7889;
update `quest_template` set `RequestItemsText` = 'To help with my workout, I like to fit a staff between heavy grinding stones, then lift the staff over my head. It isn\'t easy, but being the strongest woman in the world, like I am, can\'t be earned sitting down!$B$BCan you help me? I need more grinding stones - bring me some and I\'ll trade Darkmoon Faire tickets for them.' where `entry` = 7890;
update `quest_template` set `RequestItemsText` = 'I\'m working on a new costume, for when I have my own booth as the strongest woman alive! Right now I\'m looking for some bracers I can wear. They can\'t cover much because people want to see my muscles, but I still want to flash a little color, you know?$B$BHow about green iron bracers, $N? Can you make me green iron bracers? If you can, then I have a whole bunch of Darkmoon Faire tickets for you.' where `entry` = 7891;
update `quest_template` set `RequestItemsText` = 'For my act as the strongest woman alive, I plan to accept items from the audience and smash them with a big, black mace!$B$BCan you make me a big black mace, $N?' where `entry` = 7892;
update `quest_template` set `RequestItemsText` = '$N, in my quest to become the strongest woman alive, I have traveled the world and learned muscle building secrets from distant weight masters, strength gurus, and ancient manuals. I now know forbidden exercises that would kill the weak and cripple the uninitiated!$B$BThese feats of strength and conditioning require training with the densest of grinding stones. $N, can you find or make some grinding stones and bring them to me? I\'ll give you tickets if you do...' where `entry` = 7893;
update `quest_template` set `RequestItemsText` = 'Yebb is developing a new attraction for the Zoo Bizarre, one that will drive people crazy with wonder, and delight! But it will take a lot of work, and a lot of materials...$B$BThat includes copper modulators. We need lots of modulators for the mechanical parts of the attraction. Bring me copper modulators and I\'ll trade for them with a Darkmoon Faire ticket.' where `entry` = 7894;
update `quest_template` set `RequestItemsText` = 'My new booth will be a sight to see, yes sir! A sight to see, and... for a lucky few, to touch!$B$BI can already hear the whirring bronze gizmos singing their song of mechanical rapture as patrons step to my booth and test their skill!$B$BAh... now I need the gizmos themselves to bring my dream closer to fruition. Please, $N, bring me whirring bronze gizmos... and Darkmoon Faire tickets will be yours!' where `entry` = 7895;
update `quest_template` set `RequestItemsText` = 'When I finally get this booth up and running, I\'ll want to advertise! And what better way is there to advertise than with fireworks?$B$BWell, some might think that the smell of a cauldron, churning with the boiling heads of your foes is better for drawing crowds, but... we\'re in mixed company. So fireworks it will have to be!$B$BBring me green fireworks, $N, and I have a big fistful of Darkmoon Faire tickets for you.' where `entry` = 7896;
update `quest_template` set `RequestItemsText` = 'The biggest reason I can\'t open up my booth is that... everything\'s broken! I need mechanical repair kits to fix all this stuff!$B$BCan you bring me those kits, $N? I\'ll trade you... kits for Darkmoon Faire tickets. What do you say?' where `entry` = 7897;
update `quest_template` set `RequestItemsText` = 'Yebb Nebblegear, like me, is working on a future attraction. So amazing is this attraction, says Nebb, that it will draw folks from across the world... and it will make us all very, very rich!$B$BHe says he needs thorium widgets for its construction, and wants me to collect them for him. So what do you say, $N? Do you know where to get Thorium widgets? If you\'re an engineer, can you make them? Do you want to trade them for Darkmoon Faire tickets?' where `entry` = 7898;
update `quest_template` set `RequestItemsText` = 'The first lesson in drawing a crowd is: lure them with gadgets and trinkets! Can you help me?$B$BI need small furry paws to use for prizes. You can find those on the cats of the Barrens or Darkshore....$B$BBring me some paws and I\'ll trade you a Darkmoon Faire ticket for them.' where `entry` = 7899;
update `quest_template` set `RequestItemsText` = 'Children love toys! And no matter what race, I\'ve found that all children love furry, plushy toys made from torn bear pelts!$B$BYou can get those pelts from the bears of Ashenvale or Hillsbrad. Bring me a heap of them and earn yourself a heap of Darkmoon Faire tickets!' where `entry` = 7900;
update `quest_template` set `RequestItemsText` = 'It\'s amazing what people value! Take, for instance, a wooden stick with a soft bushy tail attached to it. Now, you and I might think something like that isn\'t all that valuable... but if you give that piece of junk a neat name like "Savage Fuzz Tail" and put it in a pretty box, then people will think it\'s valuable. Trash becomes treasure!$B$BGet me soft bushy tails from the wolves of Desolace and the Badlands, and I\'ll give you Darkmoon Faire tickets.' where `entry` = 7901;
update `quest_template` set `RequestItemsText` = 'A person\'s imagination is an incredible thing. It can make the smallest hill seem like the largest mountain. It can make the most innocuous shadow appear cast by a horrible nightmare!$B$BWe at the Darkmoon Faire let our visitor\'s imaginations blossom! But to help stretch their imaginations... sometimes we have to get tricky.$B$BI need vibrant plumes for one of my attractions. You can get them from the birds of the more dangerous areas of Azeroth. Bring me the plumes and many tickets will be yours!' where `entry` = 7902;
update `quest_template` set `RequestItemsText` = 'Do you ever find yourself wandering in a cave, late at night, looking for adventure? You do? Really? Well, then you\'ve seen the creepy eyes of bats staring at you from high up, waiting for you to let down your guard so they can suck your blood!$B$BScary thought, don\'t you think? Of course! It\'s no doubt that bat eyes are scary!$B$BWill you bring me some evil bat eyes, $N? I want them for... something I\'m designing. Something scary.$B$BYou can get them from the bats of the Eastern Plaguelands.' where `entry` = 7903;
update `quest_template` set `RequestItemsText` = '$N, thank you for all the help you\'ve given me. I really can\'t thank you enough!$B$BAlthough my need is no longer great... if you bring me more dense grinding stones, I still have more Darkmoon Faire tickets for you.' where `entry` = 7939;
update `quest_template` set `RequestItemsText` = '$N, I must thank you for all your help.  I have plenty of supplies, through no small efforts on your part, but if you wish to bring me more armor kits, then I will gladly trade them for Darkmoon Faire tickets.' where `entry` = 7941;
update `quest_template` set `RequestItemsText` = '$N, you have been so good to us, bringing me goods without tiring. You have my eternal thanks!$B$BAlthough our need for Thorium widgets is not as great as it was, you may still bring them to me and I will gladly trade them for Darkmoon Faire tickets.' where `entry` = 7942;
update `quest_template` set `RequestItemsText` = '$N, the attraction I\'m designing will be the scariest event since Gnomeregan was overrun! And it\'s largely thanks to you and all the baubles you\'ve brought me. Many, many thanks!$B$BI don\'t need much else, but... if you bring me more evil bat eyes from the bats of the Eastern Plaguelands... I might have more Darkmoon Faire tickets for you.' where `entry` = 7943;
update `quest_template` set `RequestItemsText` = 'In all my time working the Faire, I\'ve learned a lot of things about customers. Here\'s one of those nuggets of wisdom: customers love stuff that glows! It doesn\'t matter what it is - you could take a broken chair leg and make it glow, and every child will come from miles around to get one!$B$BSo, $N, I need glowing scorpid blood. You can find it from the scorpids of Sillithus, or the Blasted Lands, or the Burning Steppes.' where `entry` = 8222;
update `quest_template` set `RequestItemsText` = 'That scorpid blood is working out great, $N! It\'s amazing how a little sparkle and shine can create a prized bauble out of an otherwise piece of junk. The patrons love the stuff, and love is what it\'s all about, don\'t you think...$B$BYou\'ve been a big help to me, $N, and although I don\'t have a great need for more glowing scorpid blood, if you bring me more then I\'ll still trade you some tickets.' where `entry` = 8223;
update `quest_template` set `RequestItemsText` = 'I\'m so happy Jubjub is no longer lost. She loves Dark Iron ale so much that when I ran out... she ran away to find more!$B$BNow that Jubjub\'s back, I want as much ale as I can get! I won\'t want her to run away again!$B$BDo you have any Dark Iron Ale? If you do, then I\'ll trade you one of Jubjub\'s frog eggs for a mug...' where `entry` = 7946;


