UPDATE `npc_text` SET `text0_1`='Ragnaros will reign supreme!',`em0_0`=0,`em0_1`=1,`text1_1`='Have a drink, $c.  It might be your last!',`em1_0`=0,`em1_1`=1,`text2_1`='If it weren\'t for the Grim Guzzler, I\'d spend my free time pulling the wings off dragon whelps.',`em2_0`=0,`em2_1`=1,`text3_1`='If it weren\'t for the Grim Guzzler, I\'d probably spend my free time pulling the wings off dragon whelps.',`em3_0`=0,`em3_1`=1,`text4_1`='The water elementals are at war with the fire elementals, which sort of means they\'re at war with us.  One of their leaders, Hydraxis, is mustering agents for his cause...',`em4_0`=0,`em4_1`=1,`text5_1`='I heard that a noble among the water elementals, Hydraxis, wages war with the servants of fire.  Let\'s hope he loses!',`em5_0`=0,`em5_1`=1,`text6_1`='The Waterlord Hydraxis hides off in Azshara, on an island in the Bay of Storms.  What kind of threat can the fool muster from there?',`em6_0`=0,`em6_1`=1,`text7_1`='If Hydraxis recruits more in his war, then it might shift the balance of power...',`em7_0`=0,`em7_1`=1 WHERE `ID`=2636;
UPDATE `npc_text` SET `text0_1`='It\'s all guns and flames until someone loses and dies.',`em0_0`=0,`em0_1`=1,`text1_1`='My father told me there\'d be days like this, where a stranger would talk to me and I\'d have to restrain myself from killing $ghim:her;.',`em1_0`=0,`em1_1`=1,`text2_1`='Have you tried that Thunderbrew Lager?  It\'s good stuff!',`em2_0`=0,`em2_1`=1,`text3_1`='I have duty in an hour, but until then... bottom\'s up!',`em3_0`=0,`em3_1`=1 WHERE `ID`=2637;
