UPDATE `page_text` SET `text`='Over time, demonic entities made their way into the Titans\' worlds from the Twisting Nether, and the Pantheon elected its greatest warrior, Sargeras, to act as its first line of defense. A noble giant of molten bronze, Sargeras carried out his duties for countless millennia, seeking out and destroying these demons wherever he could find them. Over the eons, Sargeras encountered two powerful demonic races, both of which were bent on gaining power and dominance over the physical universe.' WHERE `entry`=1773;
UPDATE `page_text` SET `text`='The eredar, an insidious race of devilish sorcerers, used their warlock magics to invade and enslave a number of worlds. The indigenous races of those worlds were mutated by the eredar\'s malevolent powers and turned into demons themselves.' WHERE `entry`=1774;
UPDATE `page_text` SET `text`='Though Sargeras\' nearly limitless powers were more than enough to defeat the vile eredar, he was greatly troubled by the creatures\' corruption and all-consuming evil. Incapable of fathoming such depravity, the great Titan began to slip into a brooding depression. Despite his growing unease, Sargeras rid the universe of the warlocks by trapping them within a corner of the Twisting Nether.' WHERE `entry`=1775;
UPDATE `page_text` SET `text`='The nefarious, scheming dreadlords turned whole nations against one another by manipulating them into unthinking hatred and mistrust. Sargeras defeated the Nathrezim easily, but their corruption affected him deeply.' WHERE `entry`=1777;
UPDATE `page_text` SET `text`='His fellow Titans tried to persuade him of his error and calm his raging emotions, but he disregarded their more optimistic beliefs as self-serving delusions. Storming from their ranks forever, Sargeras set out to find his own place in the universe. Although the Pantheon was sorrowful at his departure, the Titans could never have predicted just how far their lost brother would go.' WHERE `entry`=1779;
UPDATE `page_text` SET `text`='By the time Sargeras\' madness had consumed the last vestiges of his valiant spirit, he believed that the Titans themselves were responsible for creation\'s failure. Deciding, at last, to undo their works throughout the universe, he resolved to form an unstoppable army that would set the physical universe aflame.' WHERE `entry`=1780;
UPDATE `page_text` SET `text`='Even Sargeras\' titanic form became distorted from the corruption that plagued his once-noble heart. His eyes, hair, and beard erupted in fire, and his metallic bronze skin split open to reveal an endless furnace of blistering hate.' WHERE `entry`=1781;
UPDATE `page_text` SET `text`='Kil\'jaeden\'s first move was to enslave the vampiric dreadlords under his terrible power. The dreadlords served as his personal agents throughout the universe, and they took pleasure in locating primitive races for their master to corrupt and bring into the fold. First amongst the dreadlords was Tichondrius the Darkener. Tichondrius served Kil\'jaeden as the perfect soldier and agreed to bring Sargeras\' burning will to all the dark corners of the universe.' WHERE `entry`=1784;
UPDATE `page_text` SET `text`='The mighty Archimonde also empowered agents of his own. Calling upon the malefic pit lords and their barbarous leader, Mannoroth the Destructor, Archimonde hoped to establish a fighting elite that would scour creation of all life.' WHERE `entry`=1785;
UPDATE `page_text` SET `text`='Once Sargeras saw that his armies were amassed and ready to follow his every command, he launched his raging forces into the vastness of the Great Dark. He referred to his growing army as the Burning Legion. To this date, it is still unclear how many worlds they consumed and burned on their unholy Burning Crusade across the universe.' WHERE `entry`=1786;
UPDATE `page_text` SET `text`='Gilneas and Alterac became strong supporters of Strom and developed mighty armies that explored the mountainous southern lands of Khaz Modan. It was during this period that humans first met the ancient race of dwarves and traveled to their cavernous subterranean city of Ironforge. The humans and dwarves shared many secrets of metal-smithing and engineering and discovered a common love for battle and storytelling.' WHERE `entry`=1900;
UPDATE `page_text` SET `text`='The city-state of Kul Tiras, founded upon a large island south of Lordaeron, developed a prosperous economy based on fishing and shipping. Over time, Kul Tiras built up a mighty fleet of merchant vessels that sailed throughout the known lands in search of exotic goods to trade and sell. Yet even as the economy of Arathor flourished, its strongest elements began to disintegrate.' WHERE `entry`=1901;
UPDATE `page_text` SET `text`='The few warriors still left in Strom decided to remain and guard the ancient walls of their city. Strom was no longer the center of the empire, but it developed into a new nation known as Stromgarde. Though each of the city-states became prosperous in its own right, the empire of Arathor had effectively disintegrated. As each nation developed its own customs and beliefs, they became increasingly segregated from one another. King Thoradin\'s vision of a unified humanity had faded at last.' WHERE `entry`=1905;
UPDATE `page_text` SET `text`='Kil\'jaeden kept the shaman\'s spirit alive and intact, thus leaving Ner\'zhul painfully aware of his body\'s gross dismemberment. Though Ner\'zhul pleaded with the demon to release his spirit and grant him death, the demon grimly replied that the Blood Pact they had made long ago was still binding, and that Ner\'zhul still had a purpose to serve.' WHERE `entry`=2003;
UPDATE `page_text` SET `text`='Encased within the frozen cask, Ner\'zhul felt his consciousness expand ten thousand-fold. Warped by the demon\'s chaotic powers, Ner\'zhul became a spectral being of unfathomable power. At that moment, the orc known as Ner\'zhul was shattered forever, and the Lich King was born.' WHERE `entry`=2006;
UPDATE `page_text` SET `text`='Ner\'zhul\'s loyal death knights and Shadowmoon followers were also transformed by the demon\'s chaotic energies. The wicked spellcasters were ripped apart and remade as skeletal liches. The demons had ensured that even in death, Ner\'zhul\'s followers would serve him unquestioningly.' WHERE `entry`=2007;
UPDATE `page_text` SET `text`='When the time was right, Kil\'jaeden explained the mission for which he had created the Lich King. Ner\'zhul was to spread a plague of death and terror across Azeroth that would snuff out human civilization forever. All those who died from the dreaded plague would arise as the undead, and their spirits would be bound to Ner\'zhul\'s iron will forever.' WHERE `entry`=2008;
UPDATE `page_text` SET `text`=' Kil\'jaeden promised that if Ner\'zhul accomplished his dark mission of scouring humanity from the world, he would be freed from his curse and granted a new, healthy body to inhabit.' WHERE `entry`=2009;
UPDATE `page_text` SET `text`='Tichondrius, the most powerful and cunning of the dreadlords, warmed to the challenge; he was fascinated by the plague\'s severity and the Lich King\'s unbridled potential for genocide.' WHERE `entry`=2011;
UPDATE `page_text` SET `text`='Desperate to find a cure for his people\'s racial addiction to magic, Kael did the unthinkable: he embraced his people\'s Highborne ancestry and joined with Illidan and his naga in hopes of finding a new magical power source upon which to feed. The remaining Alliance commanders condemned the blood elves as traitors and cast them out for good.' WHERE `entry`=2095;
UPDATE `page_text` SET `text`='Even weakened as he was, Arthas ultimately outmaneuvered Illidan and reached the Frozen Throne first. Using his runeblade, Frostmourne, Arthas shattered the Lich King\'s icy prison and thereby released Ner\'zhul\'s enchanted helm and breastplate.' WHERE `entry`=2101;
UPDATE `page_text` SET `text`='Arthas placed the unimaginably powerful helm on his head and became the new Lich King. Ner\'zhul and Arthas\' spirits fused into a single mighty being, just as Ner\'zhul had always planned. Illidan and his troops were forced to flee back to Outland in disgrace, while Arthas became one of the most powerful entities the world had ever known.' WHERE `entry`=2102;
UPDATE `page_text` SET `text`='Currently Arthas, the new and immortal Lich King, resides in Northrend; he is rumored to be rebuilding the citadel of Icecrown. His trusted lieutenant, Kel\'Thuzad, commands the Scourge in the Plaguelands. Sylvanas and her rebel Forsaken hold only the Tirisfal Glades, a small portion of the war-torn kingdom.' WHERE `entry`=2103;
